import { style } from '@mui/system';

const Container = styled.div`
    width:100vw;
    height:100vh;
    background-color: #ffffff;
    position:relative;
    overflow: hidden;
    display:flex;

`
const Arrow = styled.div`
    width:50px;
    height:50px;
    background-color: #f4aa75;
    border-radius: 50%;
    display:flex;
    align-items: center;
    justify-content: center;
    color:maroon;
    position:absolute;
    left:${props => props.direction === 'left' && '10px'};
    right:${props => props.direction === 'right' && '10px'};
    top:0;
    bottom:0;
    margin :auto;
    cursor: pointer;
    opacity:0.5;

`

const Wrapper = styled.div`

    display:flex;

    flex-direction: row;


`
const Slide = styled.div`
 display:flex;
 align-items: center;
